     QScriptValue REcmaSharedPointerEntity::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        REntity* self = getSelf("REntity", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    REntity* REcmaSharedPointerEntity::getSelf(const QString& fName, QScriptContext* context)
    
        {
            REntity* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<REntityPointer >(context->thisObject())
                
                    ->data()
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("REntity.%1(): "
                        "This object is not a REntity").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        REntity* REcmaSharedPointerEntity::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          REntity* selfBase = getSelf(fName, context);
                REntity* self = dynamic_cast<REntity*>(selfBase);
                //return REcmaHelper::scriptValueTo<REntity >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("REntity.%1(): "
                    "This object is not a REntity").arg(fName),
                    context);
            }

            return self;
            


        }
